                            <thead className='bg-info border' >
                                <tr>
                                    <th className='border-0 bg-info' >SI.No</th>
                                    <th className='bg-info'>Address</th>
                                    <th className='bg-info'>City</th>
                                    <th>State</th>
                                    <th>Property for</th>
                                    <th>Type</th>
                                </tr>
                            </thead>
                            <tbody>
                                {
                                    showCart.map((item, index) => (
                                        <tr key={index}>
                                            <td>{index + 1} </td>
                                            <td>{item.address} </td>
                                            <td>{item.city} </td>
                                            <td>{item.state} </td>
                                            <td>{item.propertyFor} </td>
                                            <td>{item.type} </td>
                                        </tr>
                                    ))
                                }
                            </tbody>
                        </table>
                    </div>
                </div >
            </>
        )
    }

    useEffect(() => {
        getOwnProperty()
    }, [])

    return (
        <>
            <Seller />
            <p>Manage Seller</p>
            {SellerDetails()}
        </>
    )
}

export default MyProperty;
